import React, { Component } from "react";

const ListSearchedNews = ({ snews, mode }) => {
  if (!snews.lenght > 0) {
    for (const index = 0; index <= snews.lenght; index++) {
      return (
        <>
          <div class='card mb-3' style='max-width: 540px;' mode={mode}>
            <div class='row no-gutters'>
              <div class='col-md-4'>
                <img src={index.image.contentUrl} alt='...' />
              </div>
              <div class='col-md-8'>
                <div class='card-body'>
                  <h5 class='card-title'>Title: {index.name}</h5>
                  <p class='card-text'>Description: {index.description}</p>
                  <p class='card-text'>
                    <small class='text-muted'>
                      Published on : {index.datePublished}
                    </small>
                  </p>
                </div>
              </div>
            </div>
          </div>
        </>
      );
    }
  } else {
    return <h1>Loading</h1>;
  }
};

export default ListSearchedNews;
